import React, {Component} from 'react';

class Recetas extends Component {
    render() {
        const { img, titulo, categoria, descripcion } = this.props.recetas;
        return (
            <div className="col-12 col-md-7 justify-content-center d-flex">
                    <p className="titulo-recetas">{`Recetas faciles de preparar`}</p>
                    {
                        Object.keys(this.props.recetas).map
                    }
            </div>
        )
    }
}
export default Recetas;
